import Login from "./pages/Login";
import { BrowserRouter, Routes, Route, useLocation } from "react-router-dom";
import { Counter } from "./features/counter/Counter";
import "./App.css";

function App() {
  return (
    <BrowserRouter basename="/">
      <div className="App">
        <Route path="/login" element={<Login />} />
      </div>
    </BrowserRouter>
  );
}

export default App;
